import React from 'react';
import SignUpForm from './signupForm/signupForm'

class ContentSignUp extends React.Component{
  render(){
    return(
      <div>
      <SignUpForm/>
         <button className="btn btn-primary" type="button" data-toggle="collapse" data-target=".multi-collapse" aria-expanded="false" aria-controls="multiCollapse1 multiCollapse2">Business Customer</button>
      <div>
          <div class="collapse show multi-collapse" id="multiCollapse1">
            <div class="card card-body">

            </div>
          </div>
        </div>

          <div class="collapse multi-collapse" id="multiCollapse2">
            <div class="card card-body">
            </div>
          </div>
      </div>

    )
  }
}
export default ContentSignUp
